import { Link } from 'react-router-dom';
import Element from "./DashElement";
import axios from 'axios';
import { useState, useEffect } from 'react';
import ebayLogo from '../images/ebay-logo.png'

const serverUrl = 'http://localhost:8080'

function UserDashboard(props) {

    const [ userData, setUserData ] = useState();

    useEffect(() => {
        async function fetchData(){
            await axios.get(serverUrl + '/getlistings')
                .then(res => {
                    console.log(res.data);
                    let dataArray = res.data.GetMyeBaySellingResponse.ActiveList.ItemArray.Item
                    setUserData(dataArray);   
                    console.log(dataArray);
                    console.log(userData);
                })
            .catch(err => console.log(err))
        }
        fetchData();

    },[]);

    async function getImages(url) {
        await axios.post(serverUrl + '/getimage', {
            url
        })
        .then(function(res) {
            console.log(res)
        })
        .catch(function (error) {
            console.log(error);
          });
    }

    getImages('https://www.ebay.com/itm/225652532934?hash=item3489f066c6:g:QIsAAOSwEl1ko240');

    props.funcNav('usr');

    var date = new Date();
    var year = date.getFullYear();
    var month = date.getMonth();
    var day = date.getDate();
    var hours = date.getHours();
    var ampm = hours >= 12 ? 'pm' : 'am';
    const today = month + " - " + day + " - " + year;

    const weekDay = () => {
        const weekday = ["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"];
        let day = weekday[date.getDay()];
        // console.log(day);
        // console.log(hours);
        return day;
    };

    const greeting = () => {
        if(ampm === 'am') return 'Good Monring'
        if(ampm === 'pm' && hours < 17) return 'Good Afternoon'
        if(ampm === 'pm' && hours >= 17) return 'Good Evening'
    }

    function bidcount(bids) {
       if (bids.hasOwnProperty('BidCount')) {
        return bids.BidCount._text
       } else {
        return '0'
       }
    }
    function watchcount(data) {
        if(data.hasOwnProperty('WatchCount')){
            return data.WatchCount._text
        } else {
            return '0'
        }
    }
    function listed(data) {
        let fixed = data.substring(0, 10);
        return fixed
    }

    function time(data){
        let fixed = data.replace('D', 'd ').replace('H', 'h ').replace('M', 'min ').replace('S', 'sec').slice(1).split('T')
        return fixed
    }

    function Listings() {
        if (userData) {
            return (
                userData.map((data, key) => {
                    return(
                            <tr>
                                <td>
                                    <div className="accordion">
                                            <div className="accordion-item">
                                                <h2 className="accordion-header">
                                                <button className="accordion-button collapsed bg-dark" type="button" data-bs-toggle="collapse" data-bs-target={`#flush-collapse${key}`} aria-expanded="false" aria-controls="flush-collapseOne">
                                                {data.Title._text}
                                                </button>
                                                </h2>
                                                <div id={`flush-collapse${key}`} className="accordion-collapse collapse" data-bs-parent="#accordionFlushExample">
                                                <div className="accordion-body">
                                                    <div className='container'>
                                                        <div className='row'>

                                                            <div className='col-6 col-sm-4'>
                                                                <Element
                                                                    class='listing-img' 
                                                                    body={(
                                                                        <>
                                                                            <img src="https://i.ebayimg.com/images/g/QIsAAOSwEl1ko240/s-l1600.jpg" className='product-img' />
                                                                        </>
                                                                    )}
                                                            />    
                                                            </div>
                                                            <div className='col'>
                                                                <div className='row'>

                                                                    <div className='col'>
                                                                        <Element
                                                                            class='listing-details' 
                                                                        title= {<a href={data.ListingDetails.ViewItemURL._text} target="_blank">View in  <img src={ebayLogo} style={{height:"1.2rem", width:"auto"}} /> </a>}
                                                                    />    
                                                                    </div>
                                                                    <div className='col'>
                                                                        <Element
                                                                            class='listing-details' 
                                                                            title='Listed on:'
                                                                            subtitle={( 
                                                                                <>
                                                                                    {listed(data.ListingDetails.StartTime._text)}
                                                                                </> 
                                                                            )}
                                                                        />
                                                                    </div>
                                                                    <div className='col'>
                                                                        <Element
                                                                            class='listing-details' 
                                                                            title='Bids:'
                                                                            subtitle={( 
                                                                                    <>
